import axios from "axios";

const BASE_URI = "http://localhost:8081";

export const testConnection = () => {
    try {
        // const res = await axios.get(`${BASE_URI}/test-connection`)
        const res = axios.get(`http://localhost:8081/test-connection`)
        // console.log(res)
    } catch (error) {
        console.log(error)
    }
}
